INSERT INTO public.recipes(
	id, name, photo_link, meal_time, max_imc, type, steps_desc, ingredient_desc, "createdAt", "updatedAt")
	VALUES	(1, 'Pâte à tartiner chocolat noisette', 'https://www.nutriwi.com/img/recettes/208111726-pate-a-tartiner-chocolat-noisette.jpg', 4, 25, 0, '<ol><li>Thermomix : Mettre le sucre dans le bol et les noisettes décortiquées et mixer 15sec vitesse 9.</li><li>Ajouter le chocolat et mixer 15sec vitesse 9</li><li>Verser le lait et ajouter le beurre, faire fondre 3min/50°C/vitesse 2, ensuite mixer 5sec/vitesse 9.</li><li> Verser la préparation dans un bocal en verre et placer le au réfrigérateur environ 2h. Déguster froid accompagné de crêpes par exemple !</li></ol>', '<ul><li>60g de tablette de chocolat noir</li><li>100g de lait demi-écrémé</li><li>70g de beurre doux</li><li>90g de noisettes décortiquées</li><li>90g de sucre blanc</li></ul>','2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(2, 'Porridge à la banane', 'https://sainplementhealthy.com/wp-content/uploads/2021/04/porridge-prote%CC%81ine%CC%81-a%CC%80-la-banane-sans-sucre.jpg', 10, 35, 0, '<ol><li>Dans une casserole, mettre les flocons d/avoine, le sucre et le lait (de votre choix). Fouetter doucement pour que ça n/adhère pas dans le fond.</li><li>Quand la texture est épaisse, retirer du feu et déposer le mélange dans un bol.</li><li>Découper des rondelles de banane, ajouter une cuillère du beurre de cacahuète et recouvrer le tout avec des noisettes concassées.</li></ol>', '<ul><li>1 cs de crunchy peanut butter</li><li>1 cs sucre daddy</li><li>4 cs flocons d/avoines</li><li>150g de lait demi écrémé</li><li>100g de bananes</li><li>10g de noisette</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(3, 'Biscottes à la pâte à tartiner aux noisettes', 'https://www.nutriwi.com/img/recettes/202191434-biscottes-a-la-pate-a-tartiner-aux-noisettes.jpg', 5, 25, 0, '<ol><li>Sur vos biscottes, étaler de la pâte à tartiner et disposer vos noisettes</li></ol>','<ul><li>3 biscottes</li><li>3 cc pâte à tartiner</li><li>15g de noisette</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(4, 'Pancakes faciles et rapides pour le petit déjeuner', 'https://www.nutriwi.com/img/recettes/1946191_pancakes-faciles-et-rapides-pour-le-petit-dejeuner.jpg', 15, 35, 0, '<ol><li>Verser dans un saladier l/oeuf et le sucre, puis mélanger le tout.</li><li>Après avoir fait fondre le beurre, l/ajouter dans le saladier, puis tout en mélangeant, ajouter la levure, la farine et le lait tout en délayant progressivement afin d/éviter de créer des grumeaux.</li><li>Après avoir fait chauffer votre poêle, déposer des petites louches de pâte afin de créer vos pancakes.</li><li>Lors de l/apparition de petites bulles, retourner le pancakes.</li><li>Servir tiède ou froid en fonction des goûts, avec de la confiture, du sucre ou quelques fruits.</li></ol>','<ul><li>75g farine de blé bio</li><li>0.50 cs sucre en poudre</li><li>100ml de lait de montagne</li><li>5g beurre allégé</li><li>0.50 oeufs </li><li>0.50 cc levure</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(5, 'Pancakes maison', 'https://www.nutriwi.com/img/recettes/19832153_pancakes-maison.jpg', 15, 30, 0, '<ol><li>Mélanger la farine le sucre et la levure.</li><li>Ajouter le lait, le beurre fondu et les 3 œufs. Fouetter énergiquement.</li><li>Dans une poêle chaude, déposer un peu de beurre et un tas de pâte. Retourner le pancake dès qu/il commence à crépiter.</li><li>Cette recette vous fera environ 13-15 pancakes à déguster au petit déjeuner avec du caramel au beurre salé/pate à tartiner ou des fruits</li></ol>', '<ul><li>62.50g farine semi complète</li><li>1 oeuf</li><li>0.50 cs sucre blond pure canne</li><li>12.50g beurre demi-sel</li><li>6.25cl lait 1/2 écrémé</li><li>0.25cc levure</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'), --5
			(6, 'Beurre de kaki paleo', 'https://www.recettesmania.com/images/recipe/healthymood/2022/01/healthymood-beurre-de-kaki-paleo-healthy.png', 25, 30, 0, '<ol><li>Épluchez et équeutez les kakis</li><li>Dans une casserole moyenne à feu moyen-doux, cuire les kakis avec le reste des ingrédients jusqu’à ce qu’ils soient tendres, environ 30 minutes. Remuez de temps en temps pour vous assurer que le fond ne brûle pas</li><li>Versez le tout dans un mixeur ou un robot culinaire. Mélanger jusqu’à consistance lisse comme du beurre</li></ol>', '<ul><li>6 kakis mûrs</li><li>60mL de jus de pomme</li><li>1 bâton de cannelle</li><li>1 càc de vanille</li><li>Une pincée de sel</li><li>1 càc de jus de citron</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(7, 'Smoothie bowl vitaminé kiwi', 'https://www.healthyfoodcreation.fr/wp-content/uploads/2022/01/IMG_0073-scaled.jpg', 5, 35, 0, '<ol><li>Éplucher le kiwi, la banane et la mangue puis rincer les feuilles d/épinards à l/eau froide.</li><li>Dans un Blender ou un petit mixeur, déposer le tout avec les flocons d/avoine et le jus de citron. Mixer jusqu/à l/obtention d/une cosistance homogène.</li><<li>Verser le tout dans un bol et dresser avec des morceaux de fruits, de graines au choix ou encore de muesli...puis déguster !</li><</ol>', '<ul><li>1 kiwi</li><li>1 banane</li><li>100g de mangue</li><li>1 poignée d/épinards frais</li><li>30g de flocons ou son d/avoine</li><li>1/2 jus de citron</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(8, 'Muffins noisette coeur chocolat', 'https://www.hervecuisine.com/wp-content/uploads/2020/11/recette-muffins-chocolat-noisette-coeur-coulant.jpg', 25, 25, 0, '<ol><li>Préchauffer le four à 180° (chaleur traditionelle).</li><li>Dans un saladier, mélanger les oeufs, le lait, la purée de noisette et le sirop d/agave à l/aide d/un fouet.</li><li>Ajouter ensuite la farine, la levure chimique et la pincée de sel. Mélanger jusqu/à l/obtention d/une pâte bien lisse.</li><li>Verser la pâte aux 3/4 des moules à muffins. Insérer un ou deux carré(s) de chocolat au centre de chaque muffins, puis pousser délicatement le chocolat pour le recouvrir légèrement de pâte.</li><li>Parsemer les muffins avec les pépites de chocolat et enfourner pendant 20 à 25 minutes !</li><li>Enfourner pendant 20 minutes. A la fin de la cuisson, bien laisser tiédir avant de démouler. </li><li>Pendant que les muffins cuisent, faire fondre un peu de chocolat noir dans un bol. Une fois les muffins cuits et bien refroidis, recouvrir leur surface avec un peu de chocolat fondu et de noisettes concassées !</li></ol>', '<ul><li>2 oeufs</li><li>100g de lait</li><li>100g purée de noisette</li><li>30g de sirop d/agave</li><li>110g de farine de blé au choix</li><li>1/2 sachet de levure chimique</li><li>1 pincée de sel</li><li>80g de chocolat noir</li><li>une poignée de noisettes concassées</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(9, 'Porridge spéculoos sans whey', 'https://sainplementhealthy.com/wp-content/uploads/2021/03/porridge-aux-spe%CC%81culoos.jpg', 5, 30, 0, '<ol><li>Commencer à préparer au moins 6 heures plus tôt ou la veille : réduire les spéculoos en poudre.</li><li>Dans une verrine, ajouter les flocons d/avoine, les graines de chia, les spéculoos en poudre, la cannelle, le miel, le skyr et enfin le lait demi-écrémé.</li><li>Mélanger le tout afin que les flocons d/avoine soient bien imbibés du liquide.</li><li> </li></ol>', '<ul><li>2 spéculoos</li><li>40g de flocons d’avoine (fins de préférence)</li><li>100g de skyr nature (ou fromage blanc 0% ou yaourt grec 0%)</li><li>100ml de lait demi-écrémé</li><li>5g de miel (ou sirop d’érable ou sirop de coco)</li><li>5g de graines de chia</li><li>De la cannelle en poudre</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(10, 'Omelette aux pommes de terre et jambon', 'https://www.nutriwi.com/img/recettes/21352014-omelette-aux-pommes-de-terre-et-jambon.jpg', 15, 25, 2,'<ol><li>Éplucher, couper en morceaux vos pommes de terre et les faire revenir à lhuile dolive. Saler et poivrer.</li><li>Casser et battre vos œufs, verser la préparation sur les pommes de terres cuites et déposer des morceaux de jambons sec. Laisser cuire à feu doux avec un couvercle.</li></ol>', '<ul><li> </li></ul>','2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(11, 'Rillettes de thon et chorizo', 'https://www.nutriwi.com/img/recettes/21262219-rillettes-de-thon-et-chorizo.jpg', 10, 25, 2, '<ol><li>Couper en rondelles le chorizo puis le hacher. Égoutter le thon.</li><li>Dans un récipient, mélanger le chorizo, le thon et la crème fraîche (vous pouvez mettre du fromage frais à la place).</li><li>Verser la préparation dans un ramequin et servez lors d''un apéritif ou sur des tartines de pains chauds.</li></ol>', '<ul><li>70g de thon entier naturel</li><li>2 cuillère à soupe de crème faîche épaisse légère 15%mg</li><li>10 tranches de chorizo fort supérieur pur porc</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(12, 'Couronne aux légumes d''été', 'https://www.nutriwi.com/img/recettes/19251545_couronne-aux-legumes-d-ete.jpg', 25, 30, 2, '<ol><li>Dérouler la pâte feuilletée sur une plaque allant au four. Au centre de la pâte, découper 10 parts égales en veillant à laisser une bande de pâte d''environ 10 cm de largeur tout autour.</li><li>Mélanger la ricotta avec le basilic ciselé, puis l''étaler sur la bande.</li><li>Disposer des tranches fines de courgette ainsi que des moitiés de tomates cerises. Mettre le restant de feuilles de basilics autour de la pâte.</li><li>Rabattre les pointes de pâte de chaque part vers l''extérieur afin de former le centre de la couronne. A l''aide d''un pinceau, dorer les pointes avec le jaune d''oeuf.</li><li>Enfourner 15 minutes à 210°C. Servir chaud ou froid lord d''un apéro à partager.</li></ol>', '<ul><li>100g de Ricotta 11% mat. gr.</li><li>235g de pâte feuilletée</li><li>8 feuilles de basilic frais</li><li>200g de courgette, pulpe et peau, crue</li><li>8 tomates cerise</li><li>1 oeufs jaune</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(13, 'Spaghetti aux champignons et à la crème', 'https://www.nutriwi.com/img/recettes/19261357_spaghetti-aux-champignons-et-a-la-creme.jpg', 25, 25, 2, '<ol><li>Dans une casserole d''eau bouillante, faire cuire les spaghetti pendant environ 8 minutes.</li><li>Dans une poêle, faire dégorger les champignons, puis y ajouter la crème fraiche, le sel et le poivre. Remuer environ 2-3 minutes.</li><li>Égouttez les spaghetti et les verser dans la poêle et mélanger le tout. Servir chaud.</li></ol>', '<ul><li>30g de crème fraîche épaisse</li><li>100g spaghetti</li><li>70g assortiment de champignon</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(14, 'Galette bretonne à la courgette', 'https://www.nutriwi.com/img/recettes/20149157_galette-bretonne-a-la-courgette.jpg', 25, 30, 2, '<ol><li>Eplucher, couper en cube la courgette. Verser une cuillère à soupe d''huile d''olive dans une poêle pour faire cuire la courgette.</li><li>Une fois cuit, chauffer la galette dans un poêle plate. Placer la tranche de jambon dessus, puis les courgettes. Refermer la galette puis laisser chauffer quelques minutes. (Possibilité de rajouter de l''emmental par dessus ainsi qu''un oeuf).</li></ol>', '<ul><li>1 galette</li><li>70g de courgette, pulpe et peau crue</li><li>1 tranche de jambon de poulet ou blanc de poulet en tranche</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(15, 'Wrap de tomate et avocat', 'https://www.nutriwi.com/img/recettes/19461539_wrap-de-tomate-et-avocat-rapide-a-faire.jpg', 5, 35, 2, '<ol><li>Découper la tomate et un demi avocat en morceaux.</li><li>Laver et égoutter le mais.</li><li>Dans une assiette déposer 2 wraps, puis les morceaux de tomates, d''avocats et le maïs. Assaisonner à votre gout.</li></ol>', '<ul><li>30g de maïs</li><li>2 wraps souples</li><li>100g d''avocat</li><li>1 tomate</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(16, 'Riz complet aux courgettes et oeuf mollet', 'https://i-sam.unimedias.fr/2021/05/04/palets-riz-oeufs-mollets.jpg', 20, 25, 2, '<ol><li>Mettre de l''eau à bouillir, puis y ajouter le riz complet. Comptez entre 10 et 12 minutes de cuisson. Vous pouvez utiliser cette eau pour faire cuire votre œuf mollet avant, environ 5 minutes de cuisson puis le mettre dans l''eau froide pour stopper la cuisson.</li><li>Dans une poêle, verser un peu d''huile d''olive, puis y ajouter environ 80g de courgette coupée en morceaux.</li><li>Égoutter le riz, puis disposer le dans votre assiette. Vous pouvez le mélanger dans la poele avec les courgettes si vous le désirez.</li></ol>', '<ul><li>100g de riz complet</li><li>1 oeufs frais calibres gros</li><li>1 cuillère à café d''huile d''olive vierge extra</li><li>80g de courgette, pulpe et peau crue</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(17, 'Pâtes complètes aux champignons', 'https://www.nutriwi.com/img/recettes/21131937-pates-completes-aux-champignons.jpg', 25, 25, 2, '<ol><li>Faire cuire vos pâtes complètes dans leau bouillante, pendant environ 12 minutes.</li><li>Dans une poêle, faire revenir les champignons avec un filet dhuile dolive, puis y ajouter la crème fraiche et la moutarde. Mélanger doucement et assaisonner de poivre et sel à votre convenance.</li><li>Une fois les pâtes cuites, les égoutter et les verser dans la préparation à base de champignons. Mélanger le tout et ajouter le gruyère râpé. Servir chaud.</li></ol>', '<ul><li>2 cuillière à soupe de moutarde mi-forte</li><li>400g torsades complètes</li><li>20cL de crème fraiche</li><li>150g de fromage pasteurisé emmental</li><li>150g de champignon de Paris</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(18, 'Toasts d’avocats à l’oeuf poché', 'https://www.nutriwi.com/img/recettes/191631648_toasts-d-avocats-a-l-oeuf-poche.jpg', 10, 25, 2, '<ol><li>Retirer la peau des avocats et mettre la chair dans un récipient. Écraser les avocats à la fourchette.</li><li>Toaster les tranches de pain et placer-les sur votre plan de travail. Ajouter le fromage frais puis les avocats écraser, et assaisonner à votre goût.</li><li>Enfin, faire cuire un œuf poché (dans une casserole porter l''eau à ébullition. Casser un œuf dans une louche et immerger doucement la louche. Ramener le blanc autour de l’œuf. Laisser cuire environ 3 min) et déposer le sur les tartines.</li></ol>', '<ul><li> </li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(19, 'Poulet au curry', 'https://static.750g.com/images/1200-630/91ab938d758f762c1f3f84286b121e53/adobestock-307737508.jpeg', 15, 30, 2,'<ol><li>Versez le riz dans un grand volume d''eau bouillante et suivez le temps de cuisson recommandé sur l''emballage.</li><li>coupez les filets de poulet en lamelles.</li><li>3Faites revenir le poulet dans une pôele 2 minutes avec un filet d''huile d''olive, salez et poivrez.</li><li>Une fois bien dorés, ajoutez le curry en poudre. Faite revenir 3 minutes supplémentaires à feu moyen.</li><li>5 :Versez le lait de coco et 5cl d''eau par personne. Couvrez et laissez cuire 5 minutes.</li><li>Salez, poivrez. Servez le curry avec le riz.(Optionnel: ajoutez de la coriandre frîche).</li></ol>','<ul><li>1 Poulet (escalope), 1/7 càc Curry (poudre),2 càs Lait de coco, 70 g Riz, 1/2 bouquet de Coriandre (frais) </li></ul>','2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(20, 'Burger montagnard au morbier', 'https://www.nutriwi.com/img/recettes/212892213-burger-montagnard-au-morbier.jpg', 25, 18, 2, '<ol><li>Laver et tailler en petites tranches un demi poivron et une petite tomate (ou une demie).</li>Faire cuire votre steak à la cuisson souhaitée. Une fois celui-ci prêt à votre convenance, déposer la tranche de morbier dessus et couvrir à feu doux.<li>Trancher votre pain, vous pouvez le réchauffer au four quelques minutes avant la suite de la préparation. Tartiner la sauce au poivre sur les 2 tranches. Déposer vos feuilles de salade, les tranches de tomate et de poivron. Déposer le steak avec le morbier fondu dessus. Redéposer la salade, les tomates et les tranches de poivron avant de refermer le tout. Servir tiède avec des frites.</li></ol>', '<ul><li>Steak haché 5%</li><li>Morbier</li><li>4 maxi pains hamburger</li><li>Sauce au poivre</li><li>1 Tomate</li><li>Salade verte</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'), --20 diner
			(21, 'Croque-monsieur au cheddar', 'https://www.nutriwi.com/img/recettes/214112020-croque-monsieur-au-cheddar.jpg', 10, 20, 2, '<ol><li>Sur les tranches de pain de mie, étaler le beurre.</li><li>Placer la tranche de jambon sur une des tranche de pain de mie. Redécouper celle-ci si nécessaire.</li><li>Placer une tranche de cheddar sur le jambon et refermer le sandwich. Placer au four 10 minutes à 200°C jusqu''à ce que le pain de mie soit doré.</li></ol>', '<ul><li>2 tranches de pain de mie</li><li>10g de beurre doux</li><li>1 tranche de jambon supérieur</li><li>20g de cheddar</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(22, 'Mini pizza blanche à la crème fraiche et chorizo', 'https://www.nutriwi.com/img/recettes/1968149_mini-pizza-blanche-a-la-creme-fraiche-et-chorizo.jpg', 25, 20, 2, '<ol><li>Étaler la pâte à pizza sur une plaque huilée (ou avec du papier sulfurisé) et recouvrir de crème fraîche.</li><li>Saupoudrer de fromage râpé (de l''emmental dans cette recette, mais vous pouvez varier en fonction des goûts) et répartir les tranches de chorizo et quelques tranches de tomate.</li><li>Après avoir préchauffé le four à 200°C, enfourner pour environ 10 à 15 minutes jusqu''à ce que la pâte soit bien cuite (croustillante) et le fromage doré.</li></ol>', '<ul><li>60g de fromage rapé</li><li>1 cuillière à soupe d''huile d''olive</li><li>100g de chorizo</li><li>2 cuillière à soupe de crème fraîche épaisse</li><li>50g de tomate</li><li>0.5 rouleau de pâte à pizza</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(23, 'Pâtes à la sauce tomate et basilic', 'https://www.nutriwi.com/img/recettes/19931535_pates-a-la-sauce-tomate-et-basilic.jpg', 20, 36, 2, '<ol><li> </li></ol>', '<ul><li> </li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(24, 'Pâtes bolognaises carottes et céléri', 'https://www.nutriwi.com/img/recettes/19562059_pates-bolognaises-carottes-et-celeri.jpg', 25, 18, 2, '<ol><li>Découpez les carottes et le céléri en petits morceaux, puis épluchez l''oignon et la gousse d''ail.</li><li>Faire revenir l''ail et l''oignon hachés dans une poêle avec un fond d''huile d''olive.</li><li>Ajouter le céleri et les carottes et faire revenir pendant quelques minutes. Ajoutez la viande de bœuf haché et laissez cuire jusqu’à ce que la viande soit cuite. Laisser mijoter à petit feu le temps de la cuisson des pâtes.</li><li>Faire cuire les spaghetti environ 7-8 minutes (en fonction des spaghetti).</li><li>Egoutez les spaghetti puis mélanger la sauce bolognaise avec les pâtes. Saupoudrer de fromage râpé.</li></ol>', '<ul><li>200g de spaghetti bio</li><li>2 cuillière à soupe de double concentré de tomate</li><li>60g de râpé aux 3 fromages</li><li>1 gousse ail</li><li>40g carotte crue</li><li>40g de céleri branche cru</li><li>100g oignon cru</li><li>230g de viande hachée pur boeuf</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(25, 'Poêlée de pommes de terre aux champignons frais', 'https://www.nutriwi.com/img/recettes/1956213_poelee-de-pommes-de-terre-aux-champignons-frais.jpg', 18, 22, 2, '<ol><li>Après avoir épluchez les pommes de terre, les couper en morceaux grossiers. Faire de même avec les champignons.</li><li>Hachez lail et l''échalote. Faire revenir les champignons dans une poêle/sauteuse avec du beurre.</li><li>Ajoutez y les pommes de terre, l''ail et l''échalote puis assaisonner à votre convenance.</li><li>Une fois les pommes de terre dorées et les champignons bien cuits, servir chaud dans une assiette.</li></ol>', '<ul><li>10g de beurre doux</li><li>1 gousse dail cru</li><li>120g de champignon de paris ou champignon de couche, cru</li><li>1 échalote crue</li><li>300g de pomme de terre, sans peau, crue</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(26, 'Tagliatelles aux lardons', 'https://www.nutriwi.com/img/recettes/19681414_tagliatelles-aux-lardons.jpg', 20, 25, 2,'<ol><li>Faire bouillir de l''eau avec une pincée de sel.</li><li>Faire cuire les pâtes environ 12 minutes (cela peut varier en fonction des marques), égouttez puis réserver.</li><li>Hachez votre demi oignon et le faire revenir dans une poêle chaude avec un filet d''huile d''olive. Y ajoutez les lardons et laisser cuire jusqu''à obtention d''une belle couleur. Vous pouvez les faire grillez plus longtemps, en fonction des goûts.</li><li>Verser ensuite les tagliatelles dans la poêle et remuez pour ne pas qu''elles collent. Déposer le tout dans une assiette et dressez. Assaisonner à votre convenance avec du poivre.</li></ol>', '<ul><li>1 cuillière à café d''huile d''olive</li><li>50g de lardons</li><li>60g de tagliatelles</li><li>30g d''oignon cru</li></ul>','2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(27, 'Bruschetta au bacon, tomates et champignons accompagné d’un oeuf', 'https://www.nutriwi.com/img/recettes/191362034_bruschetta-au-bacon-tomates-et-champignons-accompagne-d-un-oeuf.jpg', 25, 21, 2,'<ol><li>Pré-chauffer votre four à 180°. Sur une tartine de bruschetta, étaler le st môret.</li><li>Déposer une tranche de bacon, quelques rondelles de tomates et champignons. Pour finir, ajouter du fromage râpé.</li><li>Enfourner les bruschettas. Faire cuire l’oeuf au plat dans une poêle. Préparer votre assiette de salade assaisonnée, puis servir chaud.</li></ol>', '<ul><li>15g d''emmental</li><li>30g de St môret - format famillial</li><li>100g de pains bruschetta</li><li>20g de bacon fumé</li><li>50g de tomate crue</li><li>30g champignon de paris ou champignon de couche, crus</li><li>50g d''oeuf au plat sans matière grasse</li><li>40g de salade verte, crue, sans assaisonement</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(28, 'Poêlée de pommes de terre aux champignons frais', 'https://www.nutriwi.com/img/recettes/1956213_poelee-de-pommes-de-terre-aux-champignons-frais.jpg', 25, 28, 2, '<ol><li>Après avoir épluchez les pommes de terre, les couper en morceaux grossiers. Faire de même avec les champignons.</li><li>Hachez lail et léchalote. Faire revenir les champignons dans une poêle/sauteuse avec du beurre.</li><li>Ajoutez y les pommes de terre, lail et léchalote puis assaisonner à votre convenance.</li><li>Une fois les pommes de terre dorées et les champignons bien cuits, servir chaud dans une assiette.</li></ol>', '<ul><li> 10g de Beurre doux</li><li>1 gousse Ail</li><li>120g de Champignons de paris</li><li>1 echalotte</li><li>300g de pomme de terre</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(29, 'Tagliatelle au pesto', 'https://www.nutriwi.com/img/recettes/192341442_tagliatelle-au-pesto.jpg', 15, 23, 2, '<ol><li>Préparation du pesto : pelez la gousse dail et hachez la très finement. Mixer lail, le basilic, les pignons de pain et le parmesan.</li><li>Ajouter lhuile dolive et mixer à nouveau. Vous devez avoir obtenu une mixture homogène.</li><li>Faire cuire les tagliatelle dans de leau bouillante et salée, environ 8 à 10 minutes.</li><li>Une fois les pâtes cuites, les égouter et mélanger le pesto. Servir chaud et saupoudrez de parmesan à votre gout.</li></ol>', '<ul><li>75g Tagliatelles aux oeufs</li><li> 2cs cuillères à soupes huilde dolive</li><li>Parmigiano reggiano bio</li><li>Pignons de pin</li><li>Ail</li><li>Basilic</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(30, 'Amandes caramélisées', 'https://images.ricardocuisine.com/services/recipes/3152.jpg', 11, 20, 3, '<ol><li>Dans une casserole, ajoutez: le sucre(20g par personne) et la même quantité d''eau (2g par personne). Faites chauffer à feu vif jusqu''à ce que le mélange fasse des bulles.</li><li>Ajoutez les amandes et les mélangez sans cesse avec une cuillère en bois le temps qu''un caramel se forme et qu''il cristalise autour des amendes (environ 10 à 15 minutes).</li><li>Etalez les amandes sur une plaque de cuisson anti-adhésive ou sur une feuille de papier sulfurisé préalablement huilée et laissez refroidir. </li><li>Decollez les amandes caramélisées les unes des autres et hachez-les grossièrement si vous le souhaitez, c''est prêt !</li></ol>','<ul><li> 20 g de suscre en poudre, 30g Amandes (entières)</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
 			(31, 'Bananes caramélisée', 'https://img.cuisineaz.com/660x660/2016/03/17/i103750-bananes-caramelisees.jpg',7, 20, 3,'<ol><li>Coupez les bananes en deux dans la longueur avec ou sans peau. Dans une pôele chaude , ajoutez le beurre et laissez le fondre. Saupoudrez de sucre.</li><li>Ajoutez les bananes. Laissez cuire à feu moyen 5 minutes un caramel va se former autour de la babane. Servez les bananes avec le cramel. C''est prêt! </li></ol>','<ul><li>1 banane, 1 càc sucre (en poudre), 10g de beurre</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(32, 'Panna cotta à la fraise', 'https://www.enviedebienmanger.fr/sites/default/files/compresed_images/panacotta-a-la-fraise_0_1.jpg', 9, 30, 3,'<ol><li>Lavez puis équeutez les fraises. Coupez-les en 2 ou en 4. Deposez les fraises dans un bol et ajoutez une demi cuill. à soupe de sucre par portion. Mélangez et réservez au frais.</li><li>Faites ramollir la gélatine dans un bol d''eau froide. Réservez.</li><li>Égrainez la gousse de vanille en la coupant en deux dans le sens de la longueur puis en glissant la lame de couteau tout en raclant les grains. Gardez le reste de la gousse.</li><li>Dans une casserole, versez la crème liquide et le reste du sucre (soit 1 cuill. à soupe par portion). Faites chauffer sur feu doux.</li><li>Ajoutez les grains puis la gousse de vanille égrainée. Mélangez à l''aide d''un fouet.</li><li>Dès le début de l''ébullition, retirez la casserole du feu. Enlevez la gousse de vanille et ajoutez la gélatine égouttée. Fouettez.</li><li>Versez votre préparation dans des ramequins ou dans un moule. (Si vous souhaitez démouler les panna cotta, mouillez vos récipients sous un filet d''eau froide).</li><li>Réservez au minimum 3 heures au réfrigérateur.</li><li>Avant de dégustez vos panna cotta, ajoutez les fraises avec leur jus sur le dessus, c''est prêt ! <li></ol>','<ul><li>80g de fraises</li><li>10cL de crème liquide</li><li>2 cuillière à soupre de Suvre (en poudre)</li><li>1/4 de gousse de Vanille</li><li>1/2 gélatine</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(33, 'Salade betterave, avocat é chèvre frais', 'https://www.regal.fr/sites/art-de-vivre/files/r89-salade-concombre-avocat-betterave-chevre-noix_ss.jpg', 5, 25, 1,'<ol></li>Réalisez la vinaigrette en mélangeant 1 cuillère à café de vinaigre pour 1 cuillère à soupe d''huile d''olive et ajoutez la moutarde à l''ancienne. Salez et poivrez.</li><li>Coupez l''avocat en deux et ôtez le noyaux. Taillez ensuite des fines lamelles.</li><li>Dans un saladier, ajoutez la salade, les betteraves coupées en cubes, le chèvre émietté, l''avocat et la vinaigrette, mélangez. C''est prêt !</li></ol>','<ul><li>150 gr betterave (cuite), 2 poignées salade (mâche), 30 gr chèvre frais, 1/2 càc Moutarde à l''ancienn, 1 càc vinaigre de cidre, 1/2 avocat</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(34, 'Saint-Jacques poêlées ', 'https://img.cuisineaz.com/660x660/2019/11/20/i151033-poelee-de-saint-jacques.jpeg', 10, 28, 1,'<ol></li>Si besoin, décongelez les noix de Saint-Jacques en les plaçant dans un sac hermétique puis en plaçant ce sac dans de l''eau à température ambiante. Retirez le corail de chaque noix de Saint-Jacques en tirant légèrement.</li><li>Faites chauffer un filet d''huile dans une poêle bien chaude. Salez les noix de Saint-Jacques et ajoutez-les dans la poêle. Attention il ne faut surtout pas les remuer ! Faites cuire environ une minute. 3 :Quand les noix de Saint-Jacques sont bien dorées sous le dessous on peut les retourner, elles vont se détacher toutes seules.4 :Une fois les noix de Saint-Jacques retournées, ajoutez une noisette de beurre dans la poêle. Continuez la cuisson pendant une minute tout en arrosant. Servez les noix de Saint-Jacques. C''est prêt ! </li></ol>','<ul><li> 100 gr Noix de Saint-Jacques, 20 gr Beurre</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(35, 'Salade d''hivers Silicienne', 'https://www.sanpellegrino.com/fr/sites/g/files/xknfdk2146/files/styles/amp_1200x900_4_3/public/insalata_arance_0.jpg?itok=W0cbKkY8', 10, 30,1, '<ol><li>Lavez le fenouil et les radis.</li><li>Coupez le fenouil (gardez les feuilles pour la déco) finement.</li><li>Coupez les radis en tranches fines.</li><li>Coupez les oignons en tranches fines.</li><li>Retirez la peau des oranges, puis couper-les en tranches d’un demi centimètre environ.</li><li>Dans un plat disposez les tranches d''orange, le fenouil, les oignons et les radis.</li><li>Ajoutez un filet d''huile d''olive, le vinaigre de cidre sur le dessus, salez et poivrez. C''est prêt !</li></ol>','<ul><li> 1/2 Fenouille, 1 orange, 1/4 oignon rouge 30 gr Radis , 1 càs Vinaigre de cidre</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(36, 'Cabillaud poilée légumes au curry', 'https://cdn.nomadfoodscdn.com/-/media/project/bluesteel/findus-fr/recettes/visuels-recettes/recettes-cabillaud/curry-de-cabillaud-aux-legumes.png', 20, 35, 2, '<ol><li>Lavez, épluchez puis coupez les courgettes et les carottes en petits dés. Émincez l''ail finement.</li><li>Dans une poêle à feu vif, ajoutez un filet d''huile d''olive, l''ail et le curry, puis les carottes et courgettes. Faites revenir 7 à 10 minutes en remuant fréquemment, jusqu''à ce que les légumes soient fondants.</li><li>Dans une poêle chaude, ajoutez un peu de beurre (ou d''huile d''olive), le cabillaud, faire revenir à feu moyen 4 minutes de chaque côté. Salez poivrez en fin de cuisson. Servir avec les légumes poêlés. Ajoutez la coriandre ciselée, si vous en avez. C''est prêt ! </ol></li>', '<ul><li>1 Cabillaud (frais)</li><li>1/2 Courgette</li><li>2 carottes (frais)</li><li>1 cuillirèe à café Curry (poudre); 1/2 gou. d''ail. </li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(37, 'Cabillaud petits pois& lard', 'https://static.jow.fr/recipes/KM7N8jz5JAKXWw.jpg', 13, 35, 2,'<ol><li>Dans une casserole d''eau bouillante salée, faites cuire les petits pois pendant 8 minutes.Pendant ce temps, dans une poêle, ajoutez les tranches de lard et le cabillaud.</li><li>Retirez le lard de la poêle une fois qu''il est bien doré.</li><li>Faites cuire le cabillaud 4 minutes de chaque côté. Ajoutez un filet d''huile d''olive si besoin.</li><li>Une fois la cuisson des petits pois terminée égouttez-les puis assaisonnez-les: sel, poivre, jus de citron, fin filet d''huile d''olive,mélangez.</li><li>Servez-les avec le poisson et le lard une fois leur cuisson terminée.Râpez le zeste du citron sur le dessus, salez, poivrez, ajoutez un fin filet d''huile d''olive, c''est prêt !</li></ol>','<ul><li>1 cabillaud (frais)</li><li>200 g Petits pois (frais)</li><li>1 tranche de Lard</li><li>1/4 citron jaune.</li></ul>','2022-04-01 08:00:00', '2022-04-01 18:01:00'),
			(38,'Hamburger à l''oeuf','https://www.nutriwi.com/img/recettes/192341740_hamburger-a-l-oeuf.jpg',15,20,1,'<ol><li>Faire chauffer les pains à burger dans un four (ou à la poêle), et les laisser au chaud le temps de la préparation.</li><li>Faire cuire votre steak haché à votre gout et assaisonner avec du sel et du poivre si besoin.Si vous avez un emporte-pièce, disposez le dans une poêle chaude et casser l’œuf dedans. Sinon casser le dans une poêle et essayer qu''il ne s''étale pas trop. Laisser cuire l’œuf, le retourner si besoin, percer le jaune si vous ne souhaitez pas qu''il coule lors de la dégustation.Sortez les pains et garnissez les de sauce au poivre, puis disposez le steak, puis l’œuf (n''hésitez pas à le retailler pour ne pas qu''il sorte trop du burger), les feuilles de salade et les tranches de tomates. Vous pouvez rajouter des tranches de fromage selon vos envies. Servir chaud avec des frites maisons !</li></ol>','<ul><li>1 oeuf</li><li>2 cuillère à soupe de sauce au poivre</li><li>30g de mélange de printemps</li><li>1 pain maxi burger</li><li>1 steak haché pur boeuf</li><li>30g de tomate crue</li></ol>','2022-05-13 08:00:00', '2022-05-13 18:01:00'),
			(39,'Riz complet aux courgettes et oeuf mollet','https://www.nutriwi.com/img/recettes/19461553_riz-complet-aux-courgettes-et-oeuf-mollet.jpg',25,20,2,'<ol><li>Mettre de l''eau à bouillir, puis y ajouter le riz complet. Comptez entre 10 et 12 minutes de cuisson. Vous pouvez utiliser cette eau pour faire cuire votre œuf mollet avant, environ 5 minutes de cuisson puis le mettre dans l''eau froide pour stopper la cuisson.</li><li>Dans une poêle, verser un peu d''huile d''olive, puis y ajouter environ 80g de courgette coupée en morceaux.3:Égoutter le riz, puis disposer le dans votre assiette. Vous pouvez le mélanger dans la poele avec les courgettes si vous le désirez. </li></ol>','<ul><li>100g de Riz complet</li><li>1 oeuf</li><li>1cc huile d''olive vierge extra</li><li>80g courgette (avec pulpe et peau)</li></ol>','2022-05-13 08:00:00', '2022-05-13 18:01:00'),
			(41,'Escalope de dinde accompagné de lentilles-carottes','https://www.nutriwi.com/img/recettes/2017111521-escalope-de-dinde-accompagne-de-lentilles-carottes.jpg',30,20,1,'<ol><li>Éplucher et couper en rondelles la carotte. Verser les lentilles dans l’eau froide ainsi que les carottes, avec un bouquet garni. Porter à ébullition et laisser cuire 20-25 minutes à feu doux.</li><li>Pendant ce temps, faire cuire l’escalope de dinde et les champignons de Paris dans une poêle. Saler et poivrer.Pendant ce temps, faire cuire l’escalope de dinde et les champignons de Paris dans une poêle. Saler et poivrer.</li><li>Pour ne pas que votre viande soit trop sèche, ajouter une cuillère de boursin cuisine ou une cuillère de crème fraîche. Le repas est prêt, mangez chaud ! </li></ol>','<ul><li>70g Lentilles blondes</li><li>30g champignons de Paris</li><li>1 carotte</li><li>100g d''escalope</li></ol>','2022-05-13 08:00:00', '2022-05-13 18:01:00'),
			-- recette 41 sans lactose sans gluten
			(42,'oeufs aux tomates','https://www.nutriwi.com/img/recettes/19162119_oeufs-aux-tomates.jpg',30,20,2,'<ol><li>Couper l''oignon en fines tranches et mélanger avec les tomates concassées dans une poêle. Laisser mijoter environ 15 minutes.</li><li>Casser les œufs directement dans la poêle avec la sauce tomate et les oignons. Couvrir et laisser cuire pendant 20 à 25 minutes.</li><li> :Servir chaud avec un peu de salade et une tranche de pain.</li></ol>','<ul><li> 6 oeufs,380 g tomates pelées concassées au jus, 1 oignon crue </li></ol>','2022-05-13 08:00:00', '2022-05-13 18:01:00'),
			-- recete 42 sans lactose, sans gluten, vegetarien
			(43,'feuilleté saumon poireaux','https://www.nutriwi.com/img/recettes/2015111516-feuillete-saumon-poireaux.jpg',30,20,2,'<ol><li>Faire cuire le saumon et les blancs de poireaux préalablement coupé en morceaux. Ajouter les saint Jacques à la préparation. Saler et poivrer.2 :Laisser refroidir légèrement la préparation. Dérouler la pâte feuilletée et ajouter les poissons et les poireaux en long au milieu de la pâte.A l’aide d’un couteau, couper la pâte sur les côtés et ramener une après l’autre chaque partie découpée. Badigeonné du lait avec un pinceau sur la pâte pour qu’elle soit doré.4:Enfourner environ 20min et servir chaud ! </li></ol>','<ul><li>50g blanc de poireau</li><li>50g de pave saumon</li><li>60g pâte feuilleté</li><li>40g coquilles saint-jacques</li></ol>','2022-05-13 08:00:00', '2022-05-13 18:01:00'),

			(44,'Pavé de saumon aux épinards','https://www.nutriwi.com/img/recettes/20249158-pave-de-saumon-aux-epinards.jpg',30,20,2,'<ol><li>Dans l''eau bouillante faire blanchir les épinards. Egoutter, puis réserver.2 : Faire cuire le riz dans l''eau bouillante pendant quelques minutes. Puis égoutter les.3 :Dans une poêle, faire chauffer un filet d''huile d''olive et placer le pavé de saumon côté peau, retourner le pour qu''il soit doré. Faire revenir les épinards avec de la crème dans la poêle.4 :Server le saumon et les accompagnements chaud, avec éventuellement une sauce à la ciboulette.</li></ol>','<ul><li>1 pavé de saumon</li><li>20g de riz basmati</li><li>20g epinard cru</li></ol>','2022-05-13 08:00:00', '2022-05-13 18:01:00'),
			-- 44 : sans lactose sans gluten
			(45,'Lentilles aux lardons et champignons de Paris','https://www.nutriwi.com/img/recettes/20791459_lentilles-aux-lardons-et-champignons-de-paris.jpg', 30, 20,1,'<ol><li>Faire cuire les lentilles dans une casserole d''eau bouillante non salée 15 à 20 minutes.</li><li>Dans une poêle, faire revenir les lardons avec l''oignon émincé et les champignons de paris coupés en tranches.3:Une fois les lentilles cuite, y ajouter les lardons cuits avec les oignons. Ajoutez la moutarde et assaisonner à votre goût. Laisser sur feu doux tout en remuant régulièrement. </li></ol>','<ul><li>50g lentilles vertes</li><li>40g lardons</li><li>1 cuillière à soupe de moutarde douce</li><li>0.25 g d''oignon cru</li><li>40g champignon de Paris</li></ol>','2022-05-13 08:00:00', '2022-05-13 18:01:00'),
			--  45 sans lactose sans gluten
			(46,'Pain perdu brioché','https://assets.afcdn.com/recipe/20160629/15860_w768h583c1cx2495cy1663.webp',15, 20, 0,'<ol><li>Préparez le lait de poule : mélangez les oeufs, le lait et le sucre. Battez bien.</li><li>Dans une poêle, ajoutez une noisette de beurre.</li><li>Trempez la brioche dans le lait de poule.</li><li>Faites dorer les tranches de brioche 2 minutes de chaque côté dans la poêle.</li><li>Servez le pain perdu. (Optionnel : avec un filet de sirop d''érable). C''est prêt !</li></ol>','<ul><li>10/cL de lait</li><li>1 oeuf</li><li>40g de sucre en poudre</li><li>2 cuillière à café de sirop d''érable</li><li>160g de brioche tranchées</li></ol>','2022-05-13 08:00:00', '2022-05-13 18:01:00'),
			(47,'salade betteraves rouges et oeufs','https://www.nutriwi.com/img/recettes/20791459_salade-de-betteraves-rouges-et-oeufs.jpg',30,20,1,'<ol><li>Rincer et faire cuire les betteraves à l''autocuiseur pendant 15 à 20 minutes. Puis, les laisser refroidir et les éplucher.</li><li>Coupez en petits cubes vos betteraves et assaisonnez les avec de la vinaigrette (ou un peu de vinaigre en fonction des goûts). Haché l''ail et le persil et mélanger le tout.</li><li>Coupez vos œufs durs en 2 et disposez l''ensemble dans un plateau. Ajoutez de la salade, ciboulette ou autre crudité pour accompagner. Servir frais.</li></ol>','<ul><li>0.30 gousses d''ail</li><li>2g persil</li><li>100g betteraves rouges crue</li><li>1 oeuf</li></ol>','2022-05-13 08:00:00', '2022-05-13 18:01:00'),
			-- 47 :vegetarien sans gluten
			(48,'salade de riz fraîche accompagné de pamplemeusse de crevettes et de surimi','https://www.nutriwi.com/img/recettes/19871724_salade-de-riz-fraiche-accompagne-de-pamplemousse-de-crevettes-et-de-surimi.jpg',30,20,1,'<ol><li>Faire cuire le riz.</li><li>En attendant, couper en dés les bâtonnets de surimi, les œufs puis des quartiers de pamplemousse.</li><li>Égoutter le riz, laisser le refroidir quelques minutes. Dans un saladier ajouter le surimi, les œufs, le pamplemousse et les crevettes. Puis mettre la mayonnaise. Mélanger bien. Salée et poivrer votre entrée. </li></ol>','<ul><li>75g de riz</li><li>25g de crevettes cuites et décortiquées</li><li>2 batonnets de surimi saveur crabe</li><li>50g de plampemousse</li><li>1 oeuf dur</li></ol>','2022-05-13 08:00:00', '2022-05-13 18:01:00'),
			--  48 :sans lactose sans gluten
			(49,'terrine de poisson avec sauce cocktail','https://www.nutriwi.com/img/recettes/19682029_terrine-de-poisson-avec-sauce-cocktail.jpg',15,20,1,'<ol><li>Dans un bol, mettre l''œuf entier, la crème fraîche, la sauce tomate puis mélanger les ingrédients.Mettre le thon émietté dans un moule ainsi que les bâtonnets de crabe coupés en 2, puis verser la préparation dessus.Enfourner pendant 10 à 20 minutes à 180°C.</li><li>Démouler et découper froid. Servir avec une sauce cocktail, deux ou trois crevettes cuites, quelques asperges.</li><li>Vous pouvez également éplucher un concombre, faire un trou au milieu à l’aide d’une cuillère à melon en y ajoutant une sauce crème fraîche/ciboulette. </li></ol>','<ul><li>25g de thon entier au naturel</li><li>50g de crevettes</li><li>1cc de creme fraiche entière</li><li>25g de batonnets de surimi</li><li>25g sauce tomatebasilic</li><li>40g aspaerges vertes</li><li>0.20 concombre pulpe cru</li><li>1 oeuf</li></ol>','2022-05-13 08:00:00', '2022-05-13 18:01:00'),
			(50, 'Bircher soja aux fruits rouges', 'https://img.cuisineaz.com/660x660/2016/06/27/i93803-porridge-aux-flocons-d-avoine.webp', 5, 35, 0, '<ol><li>Placer les flocons d’avoine dans un bol puis verser le lait de soja.</li><li>Laver puis découper les fraises en morceaux et déguster frais</li></ol>', '<ul><li>250 g de flocons d/avoine</li><li>50 g de fraise</li><li>1 yaourt au soja</li><li>25 g de myrtille</li><li>20 cl de lait de soja</li></ul>', '2022-04-01 08:00:00', '2022-04-01 18:01:00'),
